import React from 'react'
import styled from 'styled-components'

const StyledMessage = styled.div`
    width: 500px;
    height: 60px;
`

function Message(props) {
    return (
        <StyledMessage>
            {props.text}
        </StyledMessage>
    )
}

export default Message
